import styled from 'styled-components';

const Wrapper = styled.main `
  text-align: center;
  display: flex;
  align-items: center;
  justify-content: center;
nav {
  display: flex;
  align-items: center;
}
  h1 {
    font-weight: 700;
    span {
      color: darkgray;
    }
  }
  p {
    color: black;
  }
`

export default Wrapper;
